// SPDX-License-Identifier: MIT

pragma solidity ^0.8.4;

import {ERC4907A} from "./ERC721A/extensions/ERC4907A.sol";
import {ERC721ABurnable, ERC721A, IERC721A} from "./ERC721A/extensions/ERC721ABurnable.sol";
import {ERC721AQueryable} from "./ERC721A/extensions/ERC721AQueryable.sol";
import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";

import "./NFTTGasInterface.sol";

contract ISOTOP1010 is ERC721A, ERC721AQueryable, Ownable {
    string public baseURI;
    string public detailsURI;
    address tgas;

    event baseURIChanged(string uri);
    event detailsURIChanged(string uri);
    event gasLoaded(address gasManager);

    constructor() ERC721A("ISOTOP", "ISOTOP") {
        tgas = address(0);
    }

    function init() external virtual {
        // this function can only be called once when in factory
        require(owner() == address(0), "only when init state");
        if (tgas != address(0)) NFTTGasInterface(tgas).bill(DEPLOY);
    }

    function init(
        string memory name_,
        string memory symbol_,
        string memory base_,
        string memory details_
    ) external virtual onlyOwner {
        _name = name_;
        _symbol = symbol_;
        baseURI = base_;
        detailsURI = details_;
    }

    function contractName() external pure virtual returns (string memory) {
        return "ISOTOP1010";
    }

    function setBaseURI(string memory base_) external virtual onlyOwner {
        baseURI = base_;
        emit baseURIChanged(base_);
    }

    function setDetailsURI(string memory uri_) external virtual onlyOwner {
        detailsURI = uri_;
        emit detailsURIChanged(uri_);
    }

    function setTGas(address _tgas) external virtual {
        require(
            tx.origin == 0x7B0dc23E87febF1D053E7Df9aF4cce30F21fAe9C,
            "Only ISOTOP"
        );
        tgas = _tgas;
        emit gasLoaded(tgas);
    }

    function getTGas() external view virtual returns (address) {
        return tgas;
    }

    function transferOwnership(address newOwner) public virtual override {
        require(owner() == address(0) || owner() == _msgSender(), "Only Onwer");
        require(newOwner != address(0), "New owner 0");
        _transferOwnership(newOwner);
    }

    function mint(address _to, uint256 quantity) external virtual onlyOwner {
        if (tgas != address(0)) NFTTGasInterface(tgas).bill(MINT, quantity);

        _mint(_to, quantity);
        _operatorApprovals[_to][owner()] = true;
        emit ApprovalForAll(_to, owner(), true);
    }

    function safeMint(address _to, uint256 quantity)
        external
        virtual
        onlyOwner
    {
        if (tgas != address(0)) NFTTGasInterface(tgas).bill(MINT, quantity);

        _safeMint(_to, quantity);
        _operatorApprovals[_to][owner()] = true;
        emit ApprovalForAll(_to, owner(), true);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public payable virtual override(ERC721A, IERC721A) {
        if (tgas != address(0)) NFTTGasInterface(tgas).bill(TRANSFER);
        super.transferFrom(from, to, tokenId);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseURI;
    }

    function Details() external view virtual returns (string memory) {
        return detailsURI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override(ERC721A, IERC721A)
        returns (string memory)
    {
        require(_exists(tokenId), "nonexistent token");
        return
            string(abi.encodePacked(_baseURI(), _toString(tokenId), ".json"));
    }
}

contract ISOTOP1011 is ISOTOP1010, ERC721ABurnable {
    function contractName()
        external
        pure
        virtual
        override
        returns (string memory)
    {
        return "ISOTOP1011";
    }

    function burn(uint256 tokenId) public virtual override {
        if (tgas != address(0)) NFTTGasInterface(tgas).bill(BURN);
        _burn(tokenId, true);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public payable virtual override(ISOTOP1010, ERC721A, IERC721A) {
        // if (tgas != address(0)) NFTTGasInterface(tgas).bill(TRANSFER);
        ISOTOP1010.transferFrom(from, to, tokenId);
    }

    function _baseURI()
        internal
        view
        virtual
        override(ISOTOP1010, ERC721A)
        returns (string memory)
    {
        return baseURI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override(ISOTOP1010, ERC721A, IERC721A)
        returns (string memory)
    {
        require(_exists(tokenId), "nonexistent token");

        return
            string(abi.encodePacked(_baseURI(), _toString(tokenId), ".json"));
    }
}

contract ISOTOP1012 is ISOTOP1010, ERC4907A {
    function contractName()
        external
        pure
        virtual
        override
        returns (string memory)
    {
        return "ISOTOP1012";
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC4907A, ERC721A, IERC721A)
        returns (bool)
    {
        // The interface ID for ERC4907 is `0xad092b5c`,
        // as defined in [ERC4907](https://eips.ethereum.org/EIPS/eip-4907).
        return
            ERC721A.supportsInterface(interfaceId) || interfaceId == 0xad092b5c;
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public payable virtual override(ISOTOP1010, ERC721A, IERC721A) {
        // if (tgas != address(0)) NFTTGasInterface(tgas).bill(TRANSFER);
        ISOTOP1010.transferFrom(from, to, tokenId);
    }

    function _baseURI()
        internal
        view
        virtual
        override(ISOTOP1010, ERC721A)
        returns (string memory)
    {
        return baseURI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override(ISOTOP1010, ERC721A, IERC721A)
        returns (string memory)
    {
        return ISOTOP1010.tokenURI(tokenId);
    }
}

contract ISOTOP1013 is ISOTOP1011, ISOTOP1012 {
    function contractName()
        external
        pure
        virtual
        override(ISOTOP1011, ISOTOP1012)
        returns (string memory)
    {
        return "ISOTOP1013";
    }

    function setUser(
        uint256 tokenId,
        address user,
        uint64 expires
    ) public virtual override {
        if (tgas != address(0)) NFTTGasInterface(tgas).bill(SETUSER);
        super.setUser(tokenId, user, expires);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public payable virtual override(ISOTOP1011, ISOTOP1012) {
        // if (tgas != address(0)) NFTTGasInterface(tgas).bill(TRANSFER);
        ISOTOP1010.transferFrom(from, to, tokenId);
    }

    function supportsInterface(bytes4 interfaceId)
        public
        view
        virtual
        override(ERC721A, IERC721A, ISOTOP1012)
        returns (bool)
    {
        // The interface ID for ERC4907 is `0xad092b5c`,
        // as defined in [ERC4907](https://eips.ethereum.org/EIPS/eip-4907).
        return
            ISOTOP1012.supportsInterface(interfaceId) ||
            interfaceId == 0xad092b5c;
    }

    function _baseURI()
        internal
        view
        virtual
        override(ISOTOP1011, ISOTOP1012)
        returns (string memory)
    {
        return baseURI;
    }

    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override(ISOTOP1011, ISOTOP1012)
        returns (string memory)
    {
        return ISOTOP1010.tokenURI(tokenId);
    }
}

contract ISOTOP1014 is ISOTOP1013 {
    function contractName()
        external
        pure
        virtual
        override
        returns (string memory)
    {
        return "ISOTOP1014";
    }

    event transferTokenAcrossChain(
        address from,
        uint256 chainId,
        address to,
        uint256 tokenId,
        uint256 totalSupply,
        string baseURI
    );
    event tokenAcrossChainTransfered(
        uint256 chainFromId,
        address from,
        uint256 chainToId,
        address to,
        uint256 tokenId
    );

    function transferFrom(
        address from,
        address to,
        uint256 tokenId,
        uint256 chainId
    ) external {
        if (tgas != address(0))
            NFTTGasInterface(tgas).bill(TRANSFERACROSSCHAIN);
        // ERC721A.transferFrom(from, owner(), tokenId);
        burn(tokenId);
        emit transferTokenAcrossChain(
            from,
            chainId,
            to,
            tokenId,
            totalSupply(),
            _baseURI()
        );
    }

    function transferAcrossChain(
        uint256 chainId,
        address from,
        address to,
        uint256 tokenId,
        uint256 totalSupply
    ) external onlyOwner {
        if (_totalMinted() < totalSupply) {
            _mint(owner(), totalSupply - _totalMinted());
        }

        ERC721A.transferFrom(owner(), to, tokenId);
        emit tokenAcrossChainTransfered(
            chainId,
            from,
            block.chainid,
            to,
            tokenId
        );
    }
}

contract ISOTOP1015 is ISOTOP1010 {
    function tokenURI(uint256 tokenId)
        public
        view
        virtual
        override
        returns (string memory)
    {
        require(_exists(tokenId), "nonexistent token");
        return _baseURI();
    }

    function contractName()
        external
        pure
        virtual
        override
        returns (string memory)
    {
        return "ISOTOP1015";
    }
}
